func toSymbol(s string) string {
  for _, symbol := range symbols {
    if s == symbol {
      return symbol
    }
  }
  return s
}

func compileSymbols(symbols []string) []string {
	var ss = make([]string, len(symbols))
	for i, s := range symbols {
		ss[i] = toSymbol(s)
	}

	return ss
}

